import { Text, View, StyleSheet, Image, SafeAreaView, TouchableOpacity } from 'react-native'
import * as React from 'react';
import Fields from '../components/Fields';
import { profileName, profilePic } from '../components/Settings';
import { useNavigation } from '@react-navigation/native';

const HomeScreen = () => {
    const navigation = useNavigation();
    return (
        <SafeAreaView style={styles.container}>
            <View>
                <View style={styles.navigationTop}>
                <Image
                    style={{width: 50, height: 50, borderRadius: 50, borderColor: 'steelblue', borderWidth: 2}}
                    source={ profilePic }
                />
                <Text style={styles.name}>{profileName}</Text>
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('AddField')}>
                    <Image
                        style={{width: 25, height: 25, marginRight: 25}}
                        source={require('../assets/images/i-plus2.png')}
                    />
                </TouchableOpacity>
                <TouchableOpacity style={styles.button} onPress={() => navigation.navigate('Details')}>
                    <Image
                        style={{width: 25, height: 25, marginRight: 15}}
                        source={require('../assets/images/034-gear.png')}
                    />
                </TouchableOpacity>
                </View>
                <View style={styles.fields}>
                    <Fields />
                </View>
            </View>
      </SafeAreaView>
    )
}

export default HomeScreen

const styles = StyleSheet.create({
    container: {
      width: '100%',
      backgroundColor: '#EEEEEE',
      flex: 1,
      flexDirection: 'column',
      alignItems: 'center',
    },
    navigationTop: {
      paddingHorizontal: 10,
      paddingVertical: 15,
      width: '100%',
      flexDirection: 'row',
      alignItems: 'center'
    },
    name: {
      flex: 1,
      fontWeight: 'bold',
      fontSize: 28,
      color: 'steelblue',
      paddingLeft: 10
    },
    buttonText: {
      fontSize: 12,
      lineHeight: 15,
      fontWeight: 'bold',
      letterSpacing: 0.25,
      color: 'black',
    },
    button: {
      marginVertical: 10,
      flexDirection: 'row',
      alignItems: 'center',
      justifyContent: 'center',
      paddingVertical: 20,
      paddingHorizontal: 20,
      backgroundColor: 'transparent',
      width: 32,
      height: 32,
      elevation: 0
    },
    fields: {
      flex: 1,
      minWidth: '100%',
    },
  });
